-- ALTER TABLE personajes
-- ADD CONSTRAINT fkidJugador
-- FOREIGN KEY (idJugador) REFERENCES jugadorDatos(idJugador)

WITH CTE AS (
    SELECT idPersonajes, idJugador,
        ROW_NUMBER() OVER (ORDER BY idPersonajes) AS rn
    FROM Personajes
)
UPDATE CTE
SET idJugador = (rn - 1) / 3 % 200 + 1
WHERE rn <= 600


